import React from 'react';
import logo from './logo.svg';
import './App.css';
import { store } from './Actions/Store';
import { Provider, connect, link } from 'react-redux';
// import Usuario from './Components/Usuarios';
//import Genero from './Components/Generos';
//  import Filme from './Components/Filmes';
import Locacao from './Components/locacaos';
import { Container } from "@material-ui/core";
import { ToastProvider } from 'react-toast-notifications'
import { BrowserRouter as Router, Route } from "react-router-dom";

function App() {
  return (
    <Provider store={ store }>
      <ToastProvider autoDismiss={true}>
        <Container maxWidth = "lg">
        <div className="App">
          teste
          <ul>
            <il><link to="/">Usuários </link></il>
            <il><link to="/">Gêneros </link></il>
            <il><link to="/">Filmes </link></il>
            <il><link to="/">Locações </link></il>
          </ul>
        </div>

          <Locacao />
        </Container>
      </ToastProvider>
    </Provider>
  );
}

export default App;
